@Component({
  selector: 'app-statuslabel',
  templateUrl: './statuslabel.component.html',
  styleUrls: ['./statuslabel.component.css']
})
export class StatuslabelComponent {
  @Input() color: string = '';
  @Output() colorChange = new EventEmitter<string>();

  changecolor() {
    this.colorChange.emit('');
  }
}
